.
Like with recipe writing, some foods & dishes come easily. They are naturally gorgeous and easy to style/photograph, like lasagna. Others are wildly challenging.
.
When I have a challenging one, I sometimes look for inspiration photos - like the photo on the left - I can use as a jumping off point.
.
I'm not the biggest fan of doing this, because it feels like using someone else's creative vision. But in the learning process this exercise has helped me understand how to balance a composition, how to use complementary and contrasting colors, and how to add interest.
.
Food photography is an art. I am still very much a student. While I guess in common terms I'm "self-taught", I think that's a misnomer. Really, it's the work of food stylists and food photographers all over the internet who are showing me the way. I'm very grateful there are so many talented teachers out there!
.
